import { Slider } from './Slider';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import slides from '../mock.json'; 
import '../css/Homepage.css';
// Install Swiper modules


export default () => {
  return (
    <div>
    <Slider slides={slides}/>
    <div className='bottom-half'>
    <div className='about'>
      <div className='image'>
        <img src='https://5.imimg.com/data5/EL/KO/MY-479538/rubber-conveyor-belt-500x500.jpg' alt='Company Logo' />
      </div>
      <div className='paragraph'>
        <h1>Gyrating Associates</h1>
        <p>We at Gyrating Associates strategically plan and focus on delivering the best to our clients in terms of quality and dependability. This eagerness to deliver the best has made us stand distinctively among our competitors. We never miss any opportunity to serve our clients with the best services.</p>
      </div>
    </div>
  </div>

    </div>
  );
};
